import React from 'react';
import './App.css';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            title: 'Rohan Bawa',
            headerLinks: [
                {title: 'Home', path: '/'},
                {title: 'About', path: '/about'},
                {title: 'Experience', path: '/experience'},
                {title: 'Contact', path: '/contact'}
            ]
        }
    }

    render() {
        return (
          <div>Hello world</div>
        );
    }

}

export default App;
